import React, { useState } from 'react';
import { Link } from 'react-router-dom'; // Import Link for navigation
import axios from 'axios';

const AddMark = () => {
  const [mark, setMark] = useState({
    studentId: '',
    subject: '',
    marks: ''
  });
  const [error, setError] = useState(null);
  const [successMessage, setSuccessMessage] = useState('');

  // Function to handle form input changes
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setMark((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  // Function to handle adding marks
  const handleAddMark = async (e) => {
    e.preventDefault();

    try {
      await axios.post('http://localhost:5000/api/addmark', mark);
      setSuccessMessage('Marks added successfully!');
      setMark({
        studentId: '',
        subject: '',
        marks: ''
      });
    } catch (err) {
      setError('Failed to add marks. Please try again.');
    }
  };

  const styles = {
    navbar: {
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      padding: '10px 20px',
      backgroundColor: '#007acc',
      color: '#fff',
      fontSize: '1rem',
    },
    navLink: {
      color: '#fff',
      textDecoration: 'none',
      margin: '0 15px',
      fontWeight: 'bold',
    },
    container: {
      padding: '30px 20px',
      maxWidth: '1200px',
      margin: '0 auto',
      backgroundColor: '#f4f4f4',
      borderRadius: '8px',
      boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    },
    header: {
      fontSize: '2rem',
      fontWeight: 'bold',
      color: '#333',
      textAlign: 'center',
      marginBottom: '30px',
    },
    error: {
      color: 'red',
      fontWeight: 'bold',
      textAlign: 'center',
      marginBottom: '20px',
    },
    success: {
      color: 'green',
      fontWeight: 'bold',
      textAlign: 'center',
      marginBottom: '20px',
    },
    form: {
      display: 'flex',
      flexDirection: 'column',
      border: '1px solid #ddd',
      padding: '20px',
      backgroundColor: '#fff',
      borderRadius: '8px',
      maxWidth: '600px',
      margin: '0 auto',
    },
    input: {
      padding: '10px',
      fontSize: '1rem',
      border: '1px solid #ccc',
      borderRadius: '4px',
      marginBottom: '15px',
    },
    button: {
      padding: '12px 20px',
      fontSize: '1rem',
      border: 'none',
      borderRadius: '5px',
      cursor: 'pointer',
      transition: 'background-color 0.3s',
      margin: '10px 0',
    },
    buttonBlue: {
      backgroundColor: '#0066cc',
      color: 'white',
    },
    buttonRed: {
      backgroundColor: '#ff6f61',
      color: 'white',
    },
  };

  return (
    <div>
      {/* Navbar with links to Home and Student List Page */}
      <nav style={styles.navbar}>
        <div>Admin Dashboard</div>
        <div>
          <Link to="/Admin_home" style={styles.navLink}>Home</Link>
          <Link to="/StudentList" style={styles.navLink}>Student List</Link>
        </div>
      </nav>

      {/* Add Mark Content */}
      <div className="add-mark" style={styles.container}>
        <h2 style={styles.header}>Add Marks</h2>
        
        {error && <p style={styles.error}>{error}</p>}
        {successMessage && <p style={styles.success}>{successMessage}</p>}

        <form onSubmit={handleAddMark} style={styles.form}>
          <input
            type="text"
            name="studentId"
            value={mark.studentId}
            onChange={handleInputChange}
            style={styles.input}
            placeholder="Student ID"
            required
          />
          <input
            type="text"
            name="subject"
            value={mark.subject}
            onChange={handleInputChange}
            style={styles.input}
            placeholder="Subject"
            required
          />
          <input
            type="number"
            name="marks"
            value={mark.marks}
            onChange={handleInputChange}
            style={styles.input}
            placeholder="Marks"
            required
          />
          <button type="submit" style={{ ...styles.button, ...styles.buttonBlue }}>Add Marks</button>
        </form>
      </div>
    </div>
  );
};

export default AddMark;
